//Contant.js-module

import { React,  Component } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux'
import EmpAction from "./../../actions/EmpAction";

//Create Contact Component

class Contact extends Component {
  constructor(props)
  {
   super(props)
   this.state = {}
  }

  componentDidMount()
  {
      this.props.EmpAction();
  }  

                      
  
render() {
  return(<>
        <div>
        <h1 className="text-center text-primary">CONTACT COMPONENT</h1>

        <p>
        Online Grammar and Writing Checker To Help You Deliver Impeccable, Mistake-free Writing. Grammarly Has a Tool For Just About Every Kind Of Writing You Do. 
        Try It Out For Yourself! Eliminate Grammar Errors. 
        Fix Punctuation Errors. Find and Add Sources Fast.
        </p>
       
        {
          this.props.empdata.map((res, i) =>
          {
              return(<ul key={i}>
                  <li>{res.id}</li>
                  <li>{res.name}</li>
                  <li>{res.email}</li>
                  <li>{res.phone}</li>
              </ul>)
          })
        } 
      </div>

  </>)
  }

}

function mapStateToProps(state) {
  return({
    empinto: state.EmpReducer
  })
}

function mapDispatchToProps(dispatch) 
{
  return bindActionCreators({ EmpAction }, dispatch)
}
export default connect(mapStateToProps,mapDispatchToProps)(Contact)
